    description: "Funhaus is a Rooster Teeth thing. \n\nFunhaus is a bunch of people\
      \ who play games. Does that mean we only play games? No - we've also got podcasts\
      \ and fan Qs&As and game shows and...well, you get the picture.\n\nWe're Adam\
      \ Kovic, Bruce Greene, James Willems, Lawrence Sonntag, Elyse Willems, Alanah\
      \ Pearce, Matt Peake, Omar de Armas, Dan Schneider, Don Casanova, Jacob Fullerton,\
      \ Adam Brouillard, Jon Smith, and John Holland. We'll play everything from GTA\
      \ to the crappiest games we can find. We'll also be doing live streams, fan\
      \ events, and collaborations with any Rooster Teeth/YouTube friends and colleagues\
      \ who wouldn't be embarrassed to be seen with us.\n\nSubscribe to Rooster Teeth\
      \ FIRST to see all of our videos up to one week early as well as lots of content\
      \ that isn't on our YouTube channel: http://bit.ly/rtfirst and type in code\
      \ \"FUNHAUS\""
